def sumOfTwoCubes(n):
    lo = 1
    hi = round(math .pow(n, 1 / 3))
    while (lo <= hi):
        curr = (lo * lo * lo + hi * hi * hi)
        if (curr == n):
            return True
        if (curr < n):
            lo += 1
        else:
            hi -= 1
    return False


