def minSwaps(b):
    n = len(b)
    for i in range(n):
        for j in range(n):
            if (b[0][0] ^ b[0][j] ^ b[i][0] ^ b[i][j]):
                return -1
    rowSum = 0
    colSum = 0
    rowSwap = 0
    colSwap = 0
    for i in range(n):
        rowSum += b[i][0]
        colSum += b[0][i]
        rowSwap += b[i][0] == i % 2
        colSwap += b[0][i] == i % 2
    if (rowSum != n // 2 and rowSum != (n + 1) // 2):
        return -1
    if (colSum != n // 2 and colSum != (n + 1) // 2):
        return -1
    if (n % 2 == 1):
        if (colSwap % 2):
            colSwap = n - colSwap
        if (rowSwap % 2):
            rowSwap = n - rowSwap
    else:
        colSwap = min(colSwap, n - colSwap)
        rowSwap = min(rowSwap, n - rowSwap)
    return (rowSwap + colSwap) // 2


