def modexp(x, n, m):
    if (n == 0):
        return 1
    else:
        if (n % 2 == 0):
            return modexp((x * x) % m, n / 2, m)
        else:
            return (x * modexp((x * x) % m, (n - 1) / 2, m) % m)


def modInverse(x, m):
    return modexp(x, m - 2, m)


