def MaxSubarrayLength(arr, n, k):
    left = -1
    sum = 0
    for i in range(n):
        if ((arr[i] % k) != 0):
            if (left == -1):
                left = i
            right = i
        sum += arr[i]
    if ((sum % k) != 0):
        return n
    elif (left == -1):
        return -1
    else:
