def isDroll(n):
    if (n == 1):
        return False
    sum_even = 0
    sum_odd = 0
    while (n % 2 == 0):
        sum_even += 2
        n = n // 2
    for i in range(3, int(math .sqrt(n)) + 1, 2):
        while (n % i == 0):
            sum_odd += i
            n = n // i
    if (n > 2):
        sum_odd += n
    return sum_even == sum_odd


