def addReduce(n, num, den):
    final_numerator = 0
    final_denominator = findlcm(den, n)
    for i in range(n):
        final_numerator = (final_numerator +
                           (num[i]) * (final_denominator // den[i]))
    GCD = gcd(final_numerator, final_denominator)
