def isPrime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if (n % i == 0 or n % (i + 2) == 0):
            return False
        i += 6
    return True


def isBalancedPrime(n):
    if not isPrime(n) or n == 2:
        return False
    previous_prime = n - 1
    next_prime = n + 1
    while not isPrime(next_prime):
        next_prime += 1
    while not isPrime(previous_prime):
        previous_prime -= 1
    mean = (previous_prime + next_prime) / 2
    if n == mean:
        return True
    else:
        return False


