    lcm = (a * b) // __gcd(a, b)
    multiples = (n // lcm) + 1
    answer = max(a, b) * multiples
    lastvalue = lcm * (n // lcm) + max(a, b)
    if (lastvalue > n):
        answer = answer - (lastvalue - n - 1)
    return answer


