        return [n]
    if (n & 1) == 0:
        return [n / 2, 2]
    a = ceil(sqrt(n))
    if (a * a == n):
        return [a, a]
    while (True):
        b1 = a * a - n
        b = int(sqrt(b1))
        if (b * b == b1):
