def minOperations(A, n):
    if n & 1:
        return -1
    zeros, consZeros, ones = 0, 0, 0
    for i in range(n):
        if A[i]:
            zeros += 1
        else:
            ones += 1
        if (i + 1 < n):
            if A[i] == 0 and A[i + 1] == 0:
                consZeros += 1
    if A[0] == A[n - 1] and A[0] == 0:
        consZeros += 1
    if zeros == ones:
        return consZeros
    else:
        return -1


