    for i in range(len(s)):
        if (((ord(s[i]) - ord('0')) % 2 & 1) == 0):
            index = i
            break
    if (index == -1):
        return duplicate
    num = 0
    for i in range(index):
        num = num * 10 + (ord(s[i]) - ord('0'))
    num = num * 10 + (ord(s[index]) - ord('0') - 1)
