from math import sqrt, pow


def isPerfectPower(n):
    if n == 1:
        return True
    for x in range(2, int(sqrt(n)) + 1):
        y = 2
        p = pow(x, y)
        while p <= n and p > 0:
            if p == n:
                return True
            y += 1
            p = pow(x, y)
    return False


def isStrongNumber(n):
    count = {i: 0 for i in range(n)}
    while n % 2 == 0:
        n = n // 2
        count[2] += 1
    for i in range(3, int(sqrt(n)) + 1, 2):
        while n % i == 0:
            n = n // i
            count[i] += 1
    if n > 2:
        count[n] += 1
    flag = 0
    for key, value in count .items():
        if value == 1:
            flag = 1
            break
    if flag == 1:
        return False
    return True


def isTrojan(n):
    return isPerfectPower(n) == False and isStrongNumber(n)


if __name__ == '__main__':
    n = 108
    if (isTrojan(n)):
        print("YES")
    else:
        print("NO")

import sys


def CalculateDifference(arr, n):
    max_val = -1
    for i in range(0, n):
        if (arr[i] > max_val):
            max_val = arr[i]
    prime = [True for i in range(max_val + 1)]
    prime[0] = False
    prime[1] = False
    p = 2
    while (p * p <= max_val):
        if prime[p]:
            for i in range(p * 2, max_val + 1, p):
                prime[i] = False
        p += 1
    S1 = 0
    S2 = 0
    for i in range(0, n):
        if prime[arr[i]]:
            S1 += arr[i]
        elif arr[i] != 1:
            S2 += arr[i]
    return abs(S2 - S1)


